import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">Welcome to React</h1>
      </header>
      <p className="App-intro">
        Edit <code>src/App.js</code> and save to reload.
      </p>
    </div>
  );
}

export default App;
